import React from 'react'

export default function NotFound() {
    return (
        <div className="container">
            <div className="row">
                <div className="col align-self-center">
                    <h4>Page Not Found</h4>
                    <h5>404</h5>
                </div>
            </div>
            
        </div>
    )
}
